function SearchContainer({data,filterId, fifty}) {

    console.log(data)
    // STATES MAPS
    const [updating, setUpdating] = useState(false);
    const [active, setActive] = useState(undefined);
    const [page, setPage] = useState(1);
    const [shape, setShape] = useState('');
    const [sortType, setSortType] = useState('');

    useEffect(() => {
        setUpdating(false);
        window.document.getElementById('results-scroll')
            .scrollTo({
                top: 0,
                behavior: 'smooth',
            });
    }, [data]);

    useEffect(() => {
        console.log('here')
        console.log(getFilterParams(filterId))
        getFilterParams(filterId)
        // const url = `https://api.idxboost.dev/search_filter/preview/${filterId}`;
        // fetch(url, {
        //     method: 'GET',
        // })
        //     .then((response) => response.json())
        //     .then((data) => {
        //         console.log(data)
        //     });
    }, [getFilterParams]);

    const handleChangeItem = useCallback((newValue, type) => {
        console.log(newValue);
        console.log(type);
    });

    return (
        <main id="flex-filters-theme">
            {fifty > 0
            && (
                <SearchFilter filter_id={filterId} search_fifty={fifty} changeItem={handleChangeItem}/>
            )
            }
            <div className="App">
                <SearchMap
                    updating={updating}
                    setUpdating={setUpdating}
                    setShape={setShape}
                    shape={shape}
                    setPage={setPage}
                    setActive={setActive}
                    active={active}
                    // data={data}
                />
                <ResultContainer
                    updating={updating}
                    setUpdating={setUpdating}
                    sortType={sortType}
                    setSortType={setSortType}
                    setActive={setActive}
                    setShape={setShape}
                    data={data}
                    page={page}
                    setPage={setPage}
                />
            </div>
        </main>
    );
}

const mapStateToProps = (state) => {
    return {
        data: state.boostData.data
    }
};

const mapDispatchToProps = {getFilterParams};

export default connect(mapStateToProps, mapDispatchToProps)(SearchContainer);
